import React from "react";
import "./App.css";
import { Layout, Header, Navigation, Content, Drawer } from "react-mdl";

function App() {
	return (
		<div style={{ height: "300px", position: "relative" }}>
			<Layout
				style={{
					background:
						"url(http://www.getmdl.io/assets/demos/transparent.jpg) center / cover"
				}}
			>
				<Header transparent title="Title" style={{ color: "white" }}>
					<Navigation>
						<a href="/">Link</a>
						<a href="/">Link</a>
						<a href="/">Link</a>
						<a href="/">Link</a>
					</Navigation>
				</Header>
				<Drawer title="Title">
					<Navigation>
						<a href="/">Link</a>
						<a href="/">Link</a>
						<a href="/">Link</a>
						<a href="/">Link</a>
					</Navigation>
				</Drawer>
				<Content />
			</Layout>
		</div>
	);
}

export default App;
